script: |
  super -f text -I q11600.spq | sort > q11600.out

inputs:
  - name: q11600.spq
    data: |
      SELECT - ( ( cor0.col2 ) ) * - cor0.col1 AS col2 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q11600.out
    data: |
      1534
      1534
      1534
      646
      646
      646
      837
      837
      837
